import React from 'react';
import { Link } from 'react-router-dom';
import PizzaCard from './PizzaCard'


export const PizzaCardList = (props) => {
	const PizaComponent = props.pizzas.map((pizza, i) => {
    return (
      <PizzaCard key={i}
        pizza = {pizza} />
    )
  })
  return (
  	<div className="AllSabores">
  	{PizaComponent}
    </div>
  );
};
